function Result=Evolusec_BoundaryTest2()
% The script infers phylogenetic tree based on multiple secondary
% structure alignment of 19 Pfam domains.
% And it also calculates the secondary structure variation around the
% boundaries within all phylogenetic trees.
%
% Well-formated table is in the supplementary file
% "SummaryTable.pdf"

Data=GetData();

Result.PFAMID=[];
Result.MSSA=[];
Result.SSTree=[];
Result.TreePairTable=[];
Result.MSSATable=[];
Result.CountTable=[];

Result=repmat(Result,size(Data));

% DoPar=false; % Change to true, if you wish to use parallel computing
DoPar=true; % Change to true, if you wish to use parallel computing

for i=1:numel(Data)
        MSSA=GetMSSA(Data(i));
        [D,~,CMatrix,ID]=SSMLTree(MSSA,'UPGMA',EvoSS('DSO-SS'),1e-8,DoPar);
        SSTree=CreatePhytreeFromBGraph(CMatrix,ID,D);
        
        TreePairTable=GetTreePairTable(SSTree);

        [~,AncSS,NodeName]=ASSR(MSSA,SSTree);
        MSSATable=[NodeName cellstr(AncSS)];


        MSSATable=SetOriginalSS(MSSATable,MSSA);

        CountTable=CalculateBoundaryVariation(TreePairTable,MSSATable);

        Result(i).PFAMID=Data(i).PFAM;
        Result(i).MSSA=MSSA;
        Result(i).SSTree=SSTree;
        Result(i).TreePairTable=TreePairTable;
        Result(i).MSSATable=MSSATable;
        Result(i).CountTable=CountTable;
end


function MSSATable=SetOriginalSS(MSSATable,MSSA)
% Using actual modern secondary structure in MSSATable.

[x,y]=ismember(MSSATable(:,1),{MSSA.Header});
MSSATable(x,2)={MSSA(y(y~=0)).SS}';


function TreePairTable=GetTreePairTable(SSTree)
% CMatrix = connected matrix
% NodeNameList = the all node names
[CMatrix,NodeNameList,~]=getmatrix(SSTree);
[Index(:,1),Index(:,2)]=find(CMatrix);
TreePairTable=NodeNameList(Index);


function MSSA=GetMSSA(Data)
% Transform cell table to struct in order to call the PHYML_SS03 function
% and construct SS phylogenetic tree
T=[Data.UniprotID Data.AlignedSS Data.AlignedSS];
MSSA=cell2struct(T,{'Header' 'Sequence' 'SS'},2);


function CountTable=CalculateBoundaryVariation(TreePairTable,MSSATable)

CountTable=zeros(size(TreePairTable,1),4);
for i=1:size(TreePairTable,1)

    AncName   =TreePairTable(i,1);
    ModernName=TreePairTable(i,2);

    AncSS=MSSATable(strcmp(MSSATable(:,1),AncName),2);
    ModernSS=MSSATable(strcmp(MSSATable(:,1),ModernName),2);

    % The boundary is defined by secondary parameter,
    %     i.e., ModernSS (the Modern protein)
    [CountTable(i,1),CountTable(i,2),CountTable(i,3),CountTable(i,4)]=...
        CountVariation(AncSS{:},ModernSS{:});
end





function [BC,nBC,nBnC,BnC]=CountVariation(AncSS,ModernSS)
% Here, isBoundary is defined by ModernSS (modern proteins)
% BC   = counts for SS in Boundary     with Change
% nBC  = counts for SS in Non-Boundary with Change
% nBnC = counts for SS in Non-Boundary with No Change
% BnC  = counts for SS in Boundary     with No Change

isBoundary=true(size(ModernSS));
for i=2:numel(ModernSS)-1
    
    if (ModernSS(i-1)==ModernSS(i))&&(ModernSS(i)==ModernSS(i+1))
        isBoundary(i)=false;
    end
end

isGap    =AncSS=='-'|ModernSS=='-';
isUnknown=AncSS=='_'|ModernSS=='_';
isChange =AncSS~=ModernSS;

BC  =numel(AncSS( isBoundary&~isGap&~isUnknown&isChange));
nBC =numel(AncSS(~isBoundary&~isGap&~isUnknown&isChange));
nBnC=numel(AncSS(~isBoundary&~isGap&~isUnknown&~isChange));
BnC =numel(AncSS( isBoundary&~isGap&~isUnknown&~isChange));



